import React from 'react';

const style = {
    color: "deepskyblue",
    border: "none",
    background: "white",
    marginTop: "20px"
}
const ClearAll = (props) =>  {
    return (
        <button style={ style } onClick={() => props.deleteAll()}>'&#x1f5d1;' Clear All</button>
    )
}

export default ClearAll;
